        macro_comment:'',
        fieldname:'',
        fieldicon:'',
        explanation_d:'<FONT face=arial size=3>The<STRONG> toolbar</STRONG> contains further pushbuttons for the following functions:<FONT size=2> </FONT>\n<P></P>\n<P class=MsoListBullet><SPAN><FONT size=3>&nbsp;<IMG src=\"alert.gif\" border=0><SPAN>&nbsp;</SPAN> </FONT><A class=tooltip href=\"../Detailed_Schedul/#\" target=_blank><FONT size=3>Alert Monitor,</FONT><SPAN><B><FONT color=#ffffff size=2><STRONG>Alert Monitor</STRONG></FONT></B><FONT size=2> </FONT>\n<P><FONT size=2></FONT>\n<DIV id=bereich_fru_01><FONT size=2>You can use the Alert Monitor to monitor whether your application is running without problems. To do this, for each of the applications you work with, you use alert profiles to specify in what situations the system reports the problem, in other words, generates an alert. In the Alert Monitor Window you can monitor all the alerts that have occurred, and can navigate directly to the relevant application function in order to resolve the problem. - SAP Help</FONT></DIV>\n<P><FONT size=2></FONT></P></SPAN></A><FONT size=2><SPAN>&nbsp;<IMG tabIndex=0 src=\"plan.gif\" border=0>&nbsp; <A class=tooltip href=\"../Detailed_Schedul/#\" target=_blank><FONT size=3>Plan Monitor,</FONT><SPAN><B><FONT color=#ffffff size=2><STRONG>Plan Monitor</STRONG></FONT></B><FONT size=2> </FONT>\n<P><FONT size=2></FONT>\n<DIV id=bereich_fru_01><FONT size=2>You can change the following profiles during a planning board session without having to end and restart the DS planning board. - SAP Help</FONT></DIV>\n<UL>\n<LI><FONT size=2>Time profile </FONT></LI>\n<LI><FONT size=2>Planning board profile </FONT></LI>\n<LI><FONT size=2>Strategy profile </FONT></LI>\n<LI><FONT size=2>Heuristic profile </FONT></LI>\n<LI><FONT size=2>Optimization profile </FONT></LI>\n<LI><FONT size=2>Alert profile </FONT></LI>\n<LI><FONT size=2>Key figure schema</FONT></LI></UL>\n<P><FONT size=2></FONT></P></SPAN></A></SPAN></FONT><A class=tooltip href=\"../Detailed_Schedul/#\" target=_blank></SPAN><FONT size=2></FONT></FONT></SPAN></A><A class=tooltip href=\"../Detailed_Schedul/#\" target=_blank><FONT size=2></FONT></FONT></SPAN></A><FONT size=2><IMG tabIndex=0 src=\"log.gif\" border=0><SPAN>&nbsp;</SPAN> </FONT><A class=tooltip href=\"../Detailed_Schedul/#\" target=_blank><FONT size=3>Logs</FONT><SPAN><B><FONT color=#ffffff size=2><STRONG>Logs</STRONG></FONT></B></FONT><FONT size=2> </FONT>\n<P>\n<DIV id=bereich_fru_01>\n<P><FONT size=2>The system collects all the messages, which appear during optimization, planning and scheduling, in logs. The following logs are available in the detailed scheduling planning board: - SAP Help</FONT> \n<P><FONT size=2></FONT></P>\n<UL>\n<LI><FONT size=2>Optimization log</FONT></LI>\n<LI><FONT size=2>Planning log</FONT></LI>\n<LI><FONT size=2>Scheduling log</FONT></SPAN></A><SPAN><FONT size=3>and <IMG tabIndex=0 alt=\"This graphic is explained in the accompanying text\" src=\"strategy.gif\" border=0><SPAN>&nbsp;</SPAN></FONT><A class=tooltip href=\"../Detailed_Schedul/#\" target=_blank><FONT size=2><FONT size=3>Strategy</FONT> </FONT><SPAN></LI></UL></DIV><B class=MsoListBullet><FONT color=#ffffff size=2><STRONG>Strategy</STRONG></FONT></B><FONT size=2> </FONT>\n<P class=MsoListBullet><FONT size=2>You can change the strategy settings at any time in interactive planning. If you have changed a strategy setting in interactive planning, the system immediately takes the changed settings into consideration for your subsequent planning activities. </FONT></P>\n<P class=MsoListBullet><FONT size=2>If you invoke the strategy settings in interactive planning, you can choose between two different views&nbsp;of the strategy profile. All settings are available in the expert view. In the application-specific view only the settings that are relevant or recommended for the related functions are available. - SAP Help</FONT></P></SPAN></A></SPAN></FONT>',
